(110, 33, 64, 1, 'I reviewed the revised texts and am pleased with the end result. The product description on my website matches my expectations and the changes have been successfully implemented.', '', 1, '2023-07-06 17:21:55', '2023-07-06 18:18:10'),
(111, 33, 1, 64, 'It was a pleasure to work with you. If you have further questions or need assistance, please contact us.', '', 1, '2023-07-06 17:24:04', '2023-07-06 18:15:58'),
(112, 34, 54, 1, 'Hi, I&#39;m in need of interpreter services for an upcoming online business meeting. We require interpretation from Italian to English. Can you assist me with that?', '', 1, '2023-07-06 17:41:29', '2023-11-20 15:52:54'),
(113, 34, 1, 54, 'Absolutely! We provide professional interpreter services for various language pairs, including Italian to English. Could you please provide us with more details about the meeting, such as the duration, the platform you&#39;ll be using, and any specific subject matter or industry terminology that will be discussed?', '', 1, '2023-07-06 17:41:50', '2023-07-06 19:53:52'),
(114, 34, 54, 1, 'The meeting will last approximately two hours and will be conducted online via video conference using Zoom. We&#39;ll be discussing topics related to finance and banking.', '', 1, '2023-07-06 17:42:18', '2023-11-20 15:52:54'),
(115, 34, 1, 54, 'Great! We have several experienced interpreters who specialize in Italian to English interpretation. Based on your requirements, I would recommend our highly skilled interpreter, Maria Costa. She specializes in Italian to English interpretation and has extensive experience in the business and finance sectors. Maria would be an excellent fit for your meeting: https://freework.world/profile/53', '', 1, '2023-07-06 17:43:02', '2023-07-06 19:53:52'),
(116, 34, 54, 1, 'That sounds great! I trust your recommendation. Let&#39;s proceed with booking Marco for our online meeting.', '', 1, '2023-07-06 17:44:03', '2023-11-20 15:52:54'),
(117, 34, 1, 54, 'Excellent choice! We will reach out to Maria and confirm her availability for your online meeting. Once we have all the necessary details, we will send you a confirmation email.', '', 1, '2023-07-06 17:46:20', '2023-07-06 19:53:52'),
(118, 34, 54, 1, 'Sounds good. I&#39;ll keep an eye on my inbox for your email. I&#39;ll provide the necessary materials and vocabulary lists to her to prepare for the meeting.', '', 1, '2023-07-06 17:46:56', '2023-11-20 15:52:54'),
(119, 34, 1, 54, 'If you have any further questions or need any additional information, feel free to reach out. We&#39;ll be in touch soon with the confirmation. Have a great day!', '', 1, '2023-07-06 17:47:43', '2023-07-06 19:53:52'),
(120, 34, 54, 1, 'Looking forward to working with you and Maria for our online meeting. Have a great day too!', '', 1, '2023-07-06 17:48:53', '2023-11-20 15:52:54'),
(121, 34, 54, 1, 'Hello, I wanted to inform you that I have successfully made the payment for the interpreter services. The transaction was completed earlier today, on the day of the business meeting.', '', 1, '2023-07-06 17:50:30', '2023-11-20 15:52:54'),
(122, 34, 1, 54, 'Thank you for notifying us. We appreciate your promptness in completing the payment. If you have any further questions or need any additional support, feel free to reach out. We&#39;re here to help.', '', 1, '2023-07-06 18:01:10', '2023-07-06 19:53:52'),
(123, 35, 77, 1, 'Hello! I am interested in hiring a freelancer to develop the back end of my website. Can you provide me with more details about the process and pricing?', '', 1, '2023-07-06 18:23:03', '2023-08-03 03:50:38'),
(124, 35, 1, 77, 'Certainly! We are a freelance platform that connects clients with experienced back end developers. We have professionals ready to help you create the back end of your website. To get started, please visit our website and explore the profiles of our experienced back-end developers.  Back end developer profile: [https://freework.world/profile/52]  In terms of pricing, our developers usually charge per project or hourly rate. Prices may vary depending on the complexity and scope of the project. After receiving confirmation of payment, we will connect you with the selected freelancer to start the project.', '', 1, '2023-07-06 18:23:16', '2023-07-06 18:26:31'),
(125, 35, 77, 1, 'I look forward to progress in developing the back end of my site. I&#39;ll be waiting for updates.', '', 1, '2023-07-06 18:23:34', '2023-08-03 03:50:38'),
(126, 35, 1, 77, 'We ensure that our back end developer will take care of everything you need to create a quality back end for your site. We will keep you updated on progress and provide regular updates.', '', 1, '2023-07-06 18:23:43', '2023-07-06 18:26:31'),
(127, 35, 77, 1, 'I reviewed the original draft and emailed a few changes and suggestions.', '', 1, '2023-07-06 18:23:51', '2023-08-03 03:50:38'),
(128, 35, 1, 77, 'We have received your letter and will carefully consider the information you provided. Our back end developer will work closely with you to make the necessary changes.', '', 1, '2023-07-06 18:24:00', '2023-07-06 18:26:31'),
(129, 35, 1, 77, 'Hello! We&#39;ve made changes based on your feedback and sent the updated text to your email. Please review it and let us know if any further adjustments are needed or if you are satisfied with the final code.', '', 1, '2023-07-06 18:24:09', '2023-07-06 18:26:31'),
(130, 35, 77, 1, 'I reviewed the edited code and am happy with the result. The work meets my expectations and the changes have been successfully implemented.', '', 1, '2023-07-06 18:24:20', '2023-08-03 03:50:38'),
(131, 35, 1, 77, 'It was a pleasure working with you to bring your website development to life. If you have further questions or need assistance, please contact us.', '', 1, '2023-07-06 18:24:37', '2023-07-06 18:26:31'),
(132, 37, 87, 1, 'Hi, I want to order a freelancer to create a logo. How can i do this?', '', 1, '2023-07-07 15:52:00', '2023-07-07 18:34:12'),
(133, 37, 1, 87, 'Hello! We are happy to help you with your order. To find a freelancer to create a logo, you can describe your requirements and preferences. We will contact suitable freelancers and provide you with information about them.', '', 1, '2023-07-07 15:52:10', '2023-07-07 18:34:15'),
(134, 37, 87, 1, 'Okay, I need a logo for my new tech business. I want the logo to be modern, with bright colors and geometric shapes. How long will it take to create a logo?', '', 1, '2023-07-07 15:52:18', '2023-07-07 18:34:12'),
(135, 37, 1, 87, 'Your description will help us find the right freelancer for your project. The time it takes to create a logo may depend on its complexity and amount of work. Usually, freelancers offer deadlines in their proposals. We can provide you with several options of freelancers and their offers, so that you can choose the most suitable one.', '', 1, '2023-07-07 15:52:31', '2023-07-07 18:34:15'),
(136, 37, 87, 1, 'Okay. I want to get several options from different freelancers. Also, I don&#39;t want to overpay. How much will it cost to create a logo?', '', 1, '2023-07-07 15:52:39', '2023-07-07 18:34:12'),
(137, 37, 1, 87, 'We understand that price is an important factor. We work with a wide range of freelancers of different levels and price categories. We will select freelancers for you, taking into account your requirements and budget. They will provide you with quotes stating the price for creating a logo. You can choose the most suitable offer.', '', 1, '2023-07-07 15:52:48', '2023-07-07 18:34:15'),
(138, 37, 1, 87, 'Here is a link to one of our recommended freelancers: [https://freework.world/profile/8]. She specializes in tech logo design and has positive reviews from previous clients. You can check out her portfolio.', '', 1, '2023-07-07 15:52:59', '2023-07-07 18:34:15'),
(139, 37, 87, 1, 'Thanks for the link. I will take a look at her work. If I like it, I will place an order and pay.', '', 1, '2023-07-07 15:53:12', '2023-07-07 18:34:12'),
(140, 37, 87, 1, 'Hi, I reviewed the first draft of the logo that the freelancer gave me. I have a few edits that I would like to make. I sent an email to the email address provided with details. Please tell the freelancer that I&#39;m waiting for a revised version.', '', 1, '2023-07-07 15:53:21', '2023-07-07 18:34:12'),
(141, 37, 1, 87, 'Hello! Thanks for the feedback. We have forwarded your letter to a freelancer, and she will work on making your changes to the logo. Expect a fixed version soon. If you have any further questions or need further assistance, please let us know.', '', 1, '2023-07-07 15:53:29', '2023-07-07 18:34:15'),
(142, 37, 87, 1, 'I received the corrected version of the logo and was quite pleased with the result. Thank you!', '', 1, '2023-07-07 15:53:53', '2023-07-07 18:34:12'),
(143, 37, 1, 87, 'No problem! We are always ready to help you. Please feel free to contact us if you have any further requirements or questions.', '', 1, '2023-07-07 15:54:39', '2023-07-07 18:34:15'),
