INSERT INTO `pages_translations` (`page_id`, `language_id`, `name`, `text`, `title`, `keyword`, `description`, `created_at`, `updated_at`) VALUES
(1, 1, 'Terms & Conditions', '<p><strong>1. Introduction</strong></p>\r\n<p>Welcome to Creativestudio.work. These Terms and Conditions govern your use of our website and services. By accessing or using our website, you agree to be bound by these Terms.</p>\r\n<p><strong>2. Use of the Website</strong></p>\r\n<ul>\r\n<li>The website is intended for users who are at least 18 years old.</li>\r\n<li>You agree to use the website only for lawful purposes and in a way that does not infringe the rights of, restrict, or inhibit anyone else’s use and enjoyment of the website.</li>\r\n</ul>\r\n<p><strong>3. Account Registration and Security</strong></p>\r\n<ul>\r\n<li>Users may need to register and create an account to access certain features of the website.</li>\r\n<li>You are responsible for maintaining the confidentiality of your account information and for all activities that occur under your account.</li>\r\n</ul>\r\n<p><strong>4. Intellectual Property Rights</strong></p>\r\n<ul>\r\n<li>The content on Creativestudio.work, including text, graphics, logos, images, as well as the compilation thereof, and any software used on the site, is the property of Creativestudio.work or its suppliers and protected by copyright and other laws.</li>\r\n<li>You agree not to reproduce, duplicate, copy, sell, resell, or exploit any portion of the website without express written permission from us.</li>\r\n</ul>\r\n<p><strong>5. </strong><strong>Changes to the Terms and Conditions</strong></p>\r\n<ul>\r\n<li>We reserve the right to revise and update these Terms and Conditions at any time. All changes are effective immediately when we post them.</li>\r\n</ul>\r\n<p><strong>6. Contact Information</strong></p>\r\n<ul>\r\n<li>To ask questions or comment about these Terms and Conditions, contact us at <a href=\"mailto:customer@creativestudio.work\">customer@creativestudio.work</a>.</li>\r\n</ul>', 'Terms & Conditions | Creativestudio.work', 'Terms, Conditions', 'These Website Terms & Conditions apply to your access and use of Creativestudio.work, including all software, data, reports, text, images, sounds, video and content.', '2022-07-06 00:31:29', '2024-01-22 18:41:04'),
(2, 1, 'Privacy Policy', '<p><strong>Last updated: January 19, 2024</strong></p>\r\n<p><span style=\"font-weight: 400;\">Welcome to Creativestudio.work. This Privacy Policy explains how we collect, use, disclose, and safeguard your information when you visit our website. We respect your privacy and are committed to protecting it through our compliance with this policy.</span></p>\r\n<p><strong>Information Collection and Use</strong></p>\r\n<p><span style=\"font-weight: 400;\">We collect several types of information from and about users of our website, including:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">1.1. Personal Information: Information by which you may be personally identified, such as name, postal address, e-mail address, and telephone number.</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"> </li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">1.2. Usage Data: Information on how the website is accessed and used.</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"> </li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">1.3. Tracking &amp; Cookies Data: We use cookies and similar tracking technologies to track activity on our website and hold certain information.</span></li>\r\n</ul>\r\n<p><strong>Use of Data</strong></p>\r\n<p><span style=\"font-weight: 400;\">Creativestudio.work uses the collected data for various purposes, including:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">To provide and maintain our website.</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">To notify you about changes to our website.</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">To allow you to participate in interactive features of our website when you choose to do so.</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">To provide customer support.</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">To gather analysis or valuable information so that we can improve our website.</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">To monitor the usage of our website.</span></li>\r\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">To detect, prevent, and address technical issues.</span></li>\r\n</ul>\r\n<p><strong>Data Sharing</strong></p>\r\n<p><span style=\"font-weight: 400;\">Creativestudio.work values your privacy and the confidentiality of your personal information. We do not sell, rent, or otherwise provide your personally identifiable information to third parties for marketing purposes.</span></p>\r\n<p><span style=\"font-weight: 400;\">Accordingly, we limit the sharing of your information as follows:</span></p>\r\n<p><strong>For Legal Reasons</strong><span style=\"font-weight: 400;\">: </span></p>\r\n<p><span style=\"font-weight: 400;\">Meet any applicable law, regulation, legal process, or enforceable governmental request.</span></p>\r\n<p><span style=\"font-weight: 400;\">Enforce applicable Terms of Service, including investigation of potential violations.</span></p>\r\n<p><span style=\"font-weight: 400;\">Detect, prevent, or otherwise address fraud, security, or technical issues.</span></p>\r\n<p><span style=\"font-weight: 400;\">Protect against harm to the rights, property, or safety of Creativestudio.work, our users, or the public as required or permitted by law.</span></p>\r\n<p><strong>Data Security</strong></p>\r\n<p><span style=\"font-weight: 400;\">We have implemented measures designed to secure your personal information from accidental loss and from unauthorized access, use, alteration, and disclosure.</span></p>\r\n<p><strong>Changes to This Privacy Policy</strong></p>\r\n<p><span style=\"font-weight: 400;\">We may update our Privacy Policy from time to time. We will notify you of any changes by posting the new Privacy Policy on this page.</span></p>\r\n<p><strong>Contact Information</strong></p>\r\n<span style=\"font-weight: 400;\">For questions about this Privacy Policy, please contact us via </span><span style=\"font-weight: 400;\"><a href=\"mailto:customer@creativestudio.work\">customer@creativestudio.work</a>.<br /></span><br />By using <span style=\"font-weight: 400;\">Creativestudio.work</span>, you consent to the practices described in this Privacy Policy. It\'s important to review this policy regularly to stay informed about how we collect, use, and protect your information.', 'Privacy Policy | Creativestudio.work', 'Privacy Policy', 'Creativestudio.work', '2022-07-06 00:31:54', '2024-01-22 14:09:39'),
(4, 1, 'About Us', '<p><strong>Creativestudio.work: Where Art Meets Innovation</strong></p>\r\n<p>Welcome to Creativestudio.work, a pioneering digital platform that is revolutionizing the way creative projects are conceived, developed, and delivered across the globe. Our journey began with a simple yet powerful vision: to create a space where the boundless creativity of freelance designers meets the diverse needs of clients from various industries.</p>\r\n<p><strong>Our Mission</strong></p>\r\n<p>At Creativestudio.work, we believe in the transformative power of design. Our mission is to make exceptional design accessible to everyone, from startups to established corporations. We strive to foster a community where creativity is celebrated, collaborations are seamless, and the results are nothing short of extraordinary.</p>\r\n<p><strong>Our Services</strong></p>\r\n<p>Specializing in a wide array of design disciplines – including web, interior, landscape, motion, brand/graphic, fashion design, and illustration – we pride ourselves on our ability to match the perfect creative talent to every project. Our platform is not just a marketplace; it’s a collaborative workspace where ideas evolve into tangible, impactful art.</p>\r\n<p><strong>Global Talent, Localized Solutions</strong></p>\r\n<p>Our strength lies in our diverse community of designers. From the avant-garde visionaries to the meticulous craftsmen, our freelancers bring a global perspective combined with local insights. This unique blend ensures that each project is infused with creativity that resonates on a universal level while catering to specific client needs.</p>\r\n<p><strong>Quality and Satisfaction: Our Dual Promise</strong></p>\r\n<p>Quality is the cornerstone of Creativestudio.work. We meticulously vet each designer, ensuring that only the most skilled, reliable, and passionate creatives join our ranks. Client satisfaction is our utmost priority, and we achieve this through transparent communication, flexible project management, and a relentless pursuit of excellence.</p>\r\n<p><strong>A Culture of Innovation and Collaboration</strong></p>\r\n<p>At the heart of Creativestudio.work is a culture of innovation and collaboration. We encourage our designers to push boundaries, think outside the box, and embrace new challenges. Our collaborative tools and project management systems are designed to streamline the creative process, ensuring a smooth, enjoyable experience for both clients and designers.</p>\r\n<p><strong>Empowering Designers, Enabling Dreams</strong></p>\r\n<p>We are more than just a platform; we are a community that nurtures talent. By offering freelance designers a stage to showcase their work, we empower them to pursue their passion on their terms. Our commitment extends beyond project completion, as we continuously support and celebrate the growth of our creative family.</p>\r\n<p><strong>Join Us in Shaping the Future of Design</strong></p>\r\n<p>As we look ahead, Creativestudio.work remains committed to elevating the world of freelance design. Whether you are a client with a vision or a designer with a dream, join us on this exciting journey. Together, let’s transform ideas into art that inspires, engages, and endures.</p>', 'About Us | Creativestudio.work', 'Creativestudio.work', 'Design Excellence Unleashed: Elevate Your Vision with Our Expert Designers – Tailored Solutions for Every Creative Endeavor!', '2022-08-11 02:15:37', '2024-01-18 17:48:32'),
(5, 1, 'Cancellations & Refunds', '<p><strong>Last updated: January 19, 2024<br /><br />1. Introduction</strong></p>\r\n<p>At Creativestudio.work, we understand that plans can change, and we strive to accommodate the needs of our clients and freelancers. This Cancellations &amp; Refunds Policy outlines the terms under which cancellations and refunds are handled on our platform.</p>\r\n<p><strong>2. Cancellations</strong></p>\r\n<ul>\r\n<li>Clients may cancel a project or service request by providing notice at least 48 hours before the scheduled start time.</li>\r\n<li>For cancellations made with sufficient notice, clients will receive a full refund.</li>\r\n<li>Cancellations made less than 48 hours before the scheduled start time may be subject to a cancellation fee of up to 25% of the agreed project fee.</li>\r\n<li><strong>By Creativestudio.work or Freelancers</strong>: In rare cases, a project or order may need to be canceled by Creativestudio.work or the assigned freelancer due to unforeseen circumstances. In such instances, clients will be notified promptly.</li>\r\n</ul>\r\n<p><strong>3. Refunds</strong></p>\r\n<ul>\r\n<li><strong>Eligibility for Refund</strong>: refunds will be processed to the original method of payment within 7-10 business days of the cancellation. We will notify both parties once the refund has been initiated.</li>\r\n<li><strong>Partial Refunds</strong>: In cases where work has already commenced, and a client wishes to cancel, a partial refund may be offered, subject to the amount of work completed.</li>\r\n</ul>\r\n<p><strong>4. Non-refundable Services</strong></p>\r\n<ul>\r\n<li>Certain services or products offered on Creativestudio.work may be non-refundable. </li>\r\n</ul>\r\n<p><strong>5. Modifications to Projects</strong></p>\r\n<ul>\r\n<li>If a client wishes to modify a project instead of canceling it, they may do so by contacting us directly. Modifications are subject to the feasibility and availability of the freelancers.</li>\r\n</ul>\r\n<p><strong>6. Dispute Resolution</strong></p>\r\n<ul>\r\n<li>In the event of a dispute regarding refunds, Creativestudio.work will mediate to find a mutually agreeable solution. Decisions by Creativestudio.work regarding refunds will be considered final.</li>\r\n</ul>\r\n<p><strong>7. Contact Information</strong></p>\r\n<ul>\r\n<li>For any questions regarding cancellations and refunds, please contact us at <a href=\"mailto:customer@creativestudio.work\">customer@creativestudio.work</a>.</li>\r\n</ul>', 'Cancellations & Refunds | Creativestudio.work', 'Cancellations, Refunds', 'Cancellations & Refunds ➤ Creativestudio.work', '2022-10-03 12:40:41', '2024-01-22 18:50:49'),
(6, 1, 'Complaints Policy', 'Last updated: September 2, 2022<br /><br /><strong>Complaints Policy</strong><br /><br />At Freework.world, we are committed to providing a platform where clients and freelancers can collaborate effectively and enjoy a positive experience. We understand that issues may occasionally arise, and we have established a transparent and fair complaint\'s policy to address any concerns you may have. Please take a moment to review our guidelines below:<br /><br /><strong>Open Communication:</strong><br /><br />We encourage open and respectful communication between clients and freelancers. If you encounter any problems or have concerns regarding a project or interaction, we recommend addressing the issue directly with the other party involved. Often, misunderstandings can be resolved through clear communication.<br /><br /><strong>Escalation Process:</strong><br /><br />If a resolution cannot be reached through direct communication, the following escalation process can be followed:<br /><br />1. <strong>Step 1: Direct Communication:</strong> As mentioned above, try to resolve the issue by discussing it directly with the other party involved. Keep all communication professional and respectful.<br /><br />2. <strong>Step 2: Contact Support:</strong> If the issue remains unresolved, you can reach out to our dedicated support team at info@freework.world. Provide detailed information about the situation, including any relevant communication and project details.<br /><br />3. <strong>Step 3: Mediation:</strong> Our support team will review the information provided and work as a neutral mediator to assist in finding a solution. We will strive to facilitate a fair resolution for all parties involved.<br /><br /><strong>Dispute Resolution:</strong><br /><br />In the event of a dispute that cannot be resolved through the above steps, Freework.world may offer dispute resolution services. Our team will carefully review all available information from both parties and make a judgment based on our policies and guidelines.<br /><br /><strong>Complaints against Freelancers:</strong><br /><br />If you are a client and have a complaint against a freelancer, we will investigate the issue thoroughly. This may involve reviewing project details, communication records, and any other relevant information. If the complaint is found to be valid, appropriate actions will be taken in accordance with our policies.<br /><br /><strong>Complaints against Clients:</strong><br /><br />If you are a freelancer and have a complaint against a client, we will similarly conduct a thorough investigation. We will consider project details, communication history, and other relevant factors. If the complaint is substantiated, we will take appropriate measures as outlined in our policies.<br /><br /><strong>Confidentiality:</strong><br /><br />We understand the importance of maintaining confidentiality throughout the complaint\'s resolution process. All parties involved are expected to treat any sensitive information with discretion and respect.<br /><br />Please note that our Complaints Policy is subject to change, and we may update it from time to time to ensure the best possible experience for all users. It\'s recommended that clients and freelancers review this page periodically to stay informed about any changes.<br /><br />For any questions or concerns regarding our Complaints Policy, please don\'t hesitate to contact our support team at info@freework.world.', 'Complaints Policy | FreeWork', 'Complaints Policy', 'Compliments and Complaints Policy ➤ Fortuna LTD is committed to providing a quality service and working in an open and accountable way.', '2022-10-04 13:54:28', '2023-08-02 16:52:52');
