(50, 1, 'Mei Chen', '', 1, 'Meichen995@outlook.com', 'I&amp;#39;m Mei, a freelance graphic designer with a passion for creating visually compelling and impactful designs. \r\n\r\nExperience:\r\n\r\nWith several years of experience in the graphic design industry, I have worked with clients across various sectors, including startups, small businesses, and established brands. This experience has honed my skills in understanding client needs, interpreting briefs, and delivering designs that align with their brand identity and objectives.\r\n\r\nProjects:\r\n\r\nI have had the opportunity to work on a diverse range of projects, including:\r\n\r\nBrand Identity\r\n\r\nPrint Design\r\n\r\nDigital Design\r\n\r\nUI/UX Design\r\n\r\nBy combining my passion for design, experience, and dedication to client satisfaction, I am confident in my ability to provide exceptional graphic design solutions that elevate brands and leave a lasting impact.', '0.00', '', NULL, 'R9dYP2Xmva9Qu48eegY85yvqM6pxViA25gd1Vaj4R3sWgNTstg6liHcJgPUCVMYyS4XGpT0Kb8JY9ALkrDli37qPyQEBgpfkqZNn', '$2y$10$PHDDvSj1AtddsC2SW90S2.WXK6i7uwU98nCrV.Hem0M6FIpwjr8ES', '1-6HOzYtsdTgO1wfAaX2gg.jpg', '1-Nk7ChgJD6jyJW6zIDVeS.jpg', '0.0000000', '0.0000000', 198, '', '', '', '60.00', '', NULL, NULL, NULL, 0, 1, '2023-07-04 08:16:15', '2024-01-23 15:46:07'),
(51, 11, 'Sofia Popescu', '', 2, 'Sofiapopescupd@hotmail.com', 'Hi, I&amp;#39;m Sofia Popescu.  I specialize in crafting product descriptions that captivate audiences and drive sales.\r\n\r\nProjects:\r\n\r\nE-commerce Product Descriptions: Creating engaging product descriptions for online stores across various industries, including fashion, electronics, home goods, and more.\r\n\r\nSEO-Optimized Content: By conducting keyword research and implementing strategic SEO techniques, I ensure that the descriptions contribute to improved online visibility and attract organic traffic to clients&amp;#39; websites.\r\n\r\nAudience Targeting: By understanding the target demographic, I create descriptions that resonate with potential customers, effectively conveying the value and benefits of the products.\r\n\r\nBrand Consistency: Ensuring that product descriptions align with the brand&amp;#39;s identity and tone of voice. \r\n\r\nExperience:\r\n\r\nI have worked with clients ranging from small startups to established e-commerce businesses. This experience has provided me with a deep understanding of various industries and market trends, allowing me to adapt my writing style and approach to different product categories.', '0.00', '', NULL, NULL, '$2y$10$9WTixvxH9xEsO5UHg6GDP.w.EkfzpjEgEA/5zGliznwa9yR/Zb4a2', '1-o0aVB2bADQfhVoFhwDlE.jpg', '1-Bd3xdCXlaXpabKq6l1AB.jpg', '0.0000000', '0.0000000', 139, '', '', '', '0.00', '', NULL, NULL, NULL, 0, 1, '2023-07-04 12:10:18', '2024-01-23 15:46:08'),
(52, 2, 'Luca Rossi', '', 1, 'lucarossit77@gmail.com', 'Greetings!\r\n\r\nI&amp;#39;m Luca, a seasoned freelance programmer with a strong passion for coding and problem-solving. With expertise in various programming languages and frameworks, I specialize in delivering efficient and scalable solutions for businesses seeking to leverage technology.\r\n\r\nObjectives:\r\n\r\nAs a freelance programmer, my main objective is to work closely with clients to understand their unique needs and deliver tailored solutions that align with their business objectives. \r\n\r\nExperience:\r\n\r\nWith several years of experience in the programming industry, I have successfully worked with clients from various sectors, including startups, small businesses, and established enterprises. This experience has provided me with a deep understanding of different business environments and project requirements.\r\n\r\nI continuously update my skills to stay abreast of the latest programming languages, frameworks, and industry best practices. This enables me to deliver cutting-edge solutions that align with current trends while ensuring code quality, efficiency, and security.\r\n\r\nLet&amp;#39;s work together to bring your ideas to life and create impactful software solutions that drive your business forward.', '0.00', '', NULL, NULL, '$2y$10$RBg0fFHqt3XLM0w5XzrBC.kRDNgsUaEPCzrRFUfy8nYTRcIQzePS.', '1-xumv3FF6BProgGbroTMH.jpg', '1-lmv4hdUUVrzQ3lL0qe66.jpg', '0.0000000', '0.0000000', 184, '', '', '', '80.00', '', NULL, NULL, NULL, 0, 1, '2023-07-04 12:32:49', '2024-01-23 15:46:09'),
(53, 10, 'Maria Costa', '', 2, 'interpretermaria7@outlook.com', 'Greetings!\r\n\r\nMaria is here.\r\n\r\nWith a strong linguistic background and an unwavering commitment to accuracy and quality, I specialize in providing professional translation services.\r\n\r\nExperience:\r\n\r\nI am a specialist in translation and proofreading, working in the marketing, creative and business fields.\r\n\r\nTranslating from Italian to English and English to Italian at the native speaker level.\r\n\r\nI have a Master&amp;#39;s degree in education and highly developed oral and written communication skills, attention to detail, and perseverance to completion as well as eight years of experience.\r\n\r\nProjects:\r\n\r\nThroughout my career, I have successfully completed various translation projects, including:\r\n\r\n- Document Translation\r\n\r\n- Website Localization:\r\n\r\n- Multimedia Translation\r\n\r\n- Software Localization\r\n\r\n- Interpretation Services', '0.00', '', NULL, NULL, '$2y$10$6KAunrB9/BPB1O4xbEyNiOTrIUTRAdMeZWdNzeNr0RnNhWYmbrBoa', '1-CXPLGEmpJDA25E8n95mT.jpg', '1-SPCjS3IvhFhktkDuRkGT.jpg', '0.0000000', '0.0000000', 110, '', '', '', '25.00', '', NULL, NULL, NULL, 0, 1, '2023-07-04 13:01:41', '2024-01-23 15:46:10'),
(54, 6, 'Lukas Hofmann', '', 0, 'pikvabejan@outlook.com', 'Welcome to our design company from Romania! We are a creative team of professionals that combines a passion for design with a passion for innovation. Our company specializes in creating unique and attractive design solutions for various industries and clients.\r\n\r\nWe are inspired by Romania&amp;#39;s rich cultural heritage and strive to reflect it in every project we develop. Our team meticulously studies trends and the latest technologies in order to offer innovative and modern design solutions that meet the needs and tastes of our customers.\r\n\r\nWe pride ourselves on our ability to create aesthetically appealing and functional designs that exceed our clients&amp;#39; expectations. We offer a wide range of services including graphic design, web design, brand development, packaging, interior design and more. Whether you need to create a new brand from scratch or update an existing design, we are ready to bring your ideas to life.', '0.00', '', NULL, 'yPJVZBmRfM4wwm7LKeoRzxQYa5X0aJHd3E1EgTOKdgIx4hNWn8LhNjg0yVKzi6hE2iggzeREta2IhWI4tfqxPCKdcQmgVAcqrrYY', '$2y$10$Dkz6bIKbTKj7QtWqdIfSEeG8DZIOjfjikGsM28gWjyvBVlsSlH7dy', '1-oxQ3gsQsk6WAKoQZjMSh.jpg', '1-Hq6ZEfxEZQmOAGYlNgom.jpg', '0.0000000', '0.0000000', 189, '', '', '', '0.00', '', NULL, NULL, NULL, 0, 1, '2023-07-04 15:54:41', '2024-01-23 15:46:11'),
