(89, 14, 'Wei Chen', '', 1, 'weichenn998@gmail.com', 'Hello,\r\n\r\nI have expertise in the curation of authentic and vibrant visual narratives that reflect the unique stories and personalities of my subjects.\r\n\r\nTo ensure the highest quality in my work, I utilize top-of-the-line materials and equipment. I combine the power of cutting-edge digital cameras with a range of professional lenses, allowing me to capture stunning details and emotions with precision. \r\n\r\nAdditionally, I employ advanced editing techniques and software to refine each image, guaranteeing a final product that exceeds expectations.', '0.00', '', NULL, NULL, '$2y$10$EXdcskwdwStjvmKynT8bOeO27zWXRATJNG5BqqQxPHx3xXOgmcpIe', '1-UfI3WmKQLo3zN2UFSnJc.jpg', NULL, '0.0000000', '0.0000000', 129, '', '', '', '35.00', '', NULL, NULL, NULL, 0, 1, '2023-07-07 16:10:40', '2024-01-23 16:26:03'),
(90, 19, 'Priya Patel', '', 2, 'pateldesign85@gmail.com', 'Hello, my name is Priya Patel, a creative and skilled children&amp;#39;s book designer specializing in providing exceptional online design services. \r\n\r\nWith a deep passion for storytelling and a keen eye for visual aesthetics, I bring stories to life through captivating illustrations, layouts, and designs.\r\n\r\nI have a good grip on Adobe Photoshop, Adobe Illustrator, and Procreate. I have worked in both Print and Web media. \r\n\r\nTo bring her designs to life, I combine traditional artistic techniques with cutting-edge digital tools. I possess a diverse range of artistic skills, including hand-drawn illustrations, digital painting, and graphic design. Using industry-standard software, I meticulously refine my illustrations, adding vibrant colors, intricate details, and imaginative elements that captivate the imaginations of young readers.\r\n\r\nAs an online service provider, my services are offered to clients from around the globe.', '0.00', '', NULL, NULL, '$2y$10$1B/V20M4nABlj/zxGNXXZemFlZGqL4Bk4eEr8vjwIsMEiOebT2aJi', '1-PKlMpfclocWmPN3VZNCE.jpg', '1-ZUBSUZHMmlHepsGzUq2R.jpg', '0.0000000', '0.0000000', 166, '', '', '', '25.00', '', NULL, NULL, NULL, 0, 1, '2023-07-07 16:42:26', '2024-01-23 16:26:04'),
(91, 23, 'Sophia Wong', '', 2, 'casesophiawong@gmail.com', 'Hello, \r\nMy name is Sophia and I&amp;#39;m specialized in preparing case studies (which lies in distilling complex business scenarios into engaging narratives that highlight key challenges, strategies, and outcomes). \r\n\r\nThe process starts with conducting thorough research, interviewing relevant stakeholders, and meticulously crafting a narrative that presents a comprehensive view of the project or problem at hand.\r\n\r\nMy writing style combines the art of storytelling with the precision of concise business writing, ensuring that each case study resonates with the target audience—whether it&amp;#39;s potential clients, industry peers, or stakeholders.\r\n\r\nHere I understand the importance of visual representation and collaborate with graphic designers to create engaging infographics and visuals that enhance the overall readability and comprehension of the case study.\r\n\r\nLet&amp;#39;s chat for more information.', '0.00', '', NULL, NULL, '$2y$10$BNP4FjTznfHTE83wpUBgxOe/C60AtBaRi/Lp4xQ019h/uYP4ObyBK', '1-oQ5zUMK0TjGFCeCgcL63.jpg', NULL, '0.0000000', '0.0000000', 20, '', '', '', '40.00', '', NULL, NULL, NULL, 0, 1, '2023-07-07 16:59:46', '2024-01-23 16:26:00'),
(92, 12, 'Minji Kim', '', 2, 'Minjikimphoto@gmail.com', 'My expertise lies in crafting engaging and descriptive narratives that capture the essence of jewelry pieces. \r\n\r\nI  possess an in-depth knowledge of gemstones, metals, and jewelry craftsmanship, allowing her to effectively communicate the unique qualities and characteristics of each piece.\r\n\r\nAs a skilled freelancer, I stay up to date with the latest trends and techniques in jewelry photography and collaborate closely with photographers, ensuring that my written content complements the visual elements and enhances the overall presentation of the jewelry. \r\n\r\nThrough my freelance services, I collaborate closely with jewelry designers, retailers, and e-commerce platforms.', '0.00', '', NULL, NULL, '$2y$10$nq6V.a54P.YTTAkF9cKRYOZmDXNhENPNuXNgMqJPS7CVTQFZUSMEm', '1-JZgh6x5JxaB7Sb16V9yY.jpg', '1-OgQYKXTkM7Z4KcrVHkLn.jpg', '0.0000000', '0.0000000', 184, '', '', '', '30.00', '', NULL, NULL, NULL, 0, 1, '2023-07-07 17:23:42', '2024-01-23 16:25:59'),
(93, 21, 'Farid Ali', '', 1, 'farid.ali@gmail.com', 'Hi, I&amp;#39;m Farid a skilled web designer with 8 years of professional experience.\r\n\r\nThrough a combination of strategic design elements and persuasive visuals, I create landing pages that captivate attention, communicate value propositions, and encourage visitors to take the desired actions, whether it&amp;#39;s making a purchase, signing up for a newsletter, or scheduling a consultation.\r\n\r\nI carefully consider factors such as color psychology, typography, and layout to create a seamless and engaging user experience.\r\n\r\nIn addition to visual design, I have a solid understanding of web development and coding languages such as HTML, CSS, and JavaScript. \r\n\r\nThis enables me to create landing pages that are not only visually appealing but also technically optimized for performance and responsiveness across various devices and browsers.', '0.00', '', NULL, NULL, '$2y$10$c/sVgh3gmwAZ/PT4WTJlDOpoO7yy0ObTwfjV6DlU74.xwI5qcmBTa', '1-Ouf38NYGOrBXi3Y7itCM.jpg', '1-n0LcY1LIHZFcmSVTiZ9S.jpg', '0.0000000', '0.0000000', 187, '', '', '', '45.00', '', NULL, NULL, NULL, 0, 1, '2023-07-07 17:40:17', '2024-01-23 16:25:59'),
(94, 24, 'Ivana Kovač', '', 2, 'ivana.kovac@gmail.com', 'Greetings\r\n\r\nI&amp;#39;m Ivana, a freelancer with a specialization in creating captivating ebooks. With a passion for storytelling and a meticulous eye for design, I bring expertise in crafting visually appealing and engaging ebooks that leave a lasting impact on readers.\r\n\r\nWhether it&amp;#39;s an informative guide, a fictional narrative, or a comprehensive manual, May&amp;#39;s creative approach ensures that the ebook captures attention, engages readers, and delivers a seamless reading experience.\r\n\r\nMy experience covers:\r\n\r\n- Proficiency in using ebook design software such as Adobe InDesign, Sigil, or Calibre to create professional layouts.\r\n\r\n- Knowledge of typography, layout principles, and design elements to enhance readability and visual appeal.\r\n\r\n- Ability to incorporate multimedia elements such as images, videos, and interactive features to enrich the ebook experience.\r\n\r\n- Understanding of different ebook formats (e.g., PDF, EPUB, MOBI) and their specific requirements.\r\n\r\n- Attention to detail in proofreading and editing to maintain accuracy and professionalism. Knowledge of metadata and search engine optimization (SEO) strategies.\r\n\r\n- Collaboration with authors and publishers to understand their vision, target audience, and branding guidelines.', '0.00', '', NULL, NULL, '$2y$10$3gdULUKqaF8tnLYH6kQPsuspf7wvwgcQpJRxBxhdXCIFsV7.t5YPe', '1-WInVo3dNPNEYoChO54Ee.jpg', '1-Jo9VDmG3lYa0ZGAUCWsk.jpg', '0.0000000', '0.0000000', 190, '', '', '', '25.00', '', NULL, NULL, NULL, 0, 1, '2023-07-07 17:57:45', '2024-01-23 15:50:34'),
(95, 16, 'Ana Petrovic', '', 2, 'anapetrovic2023@outlook.com', 'Hello, my name is Ana, a specialized influencer marketing manager.\r\n\r\nI help businesses leverage the power of influencer collaborations to reach and engage their target audience effectively.\r\n\r\nMy expertise lies in crafting influencer marketing strategies that align with a brand&amp;#39;s objectives and resonate with its target audience. \r\n\r\nWhy me:\r\n\r\n- Proficiency in conducting thorough research and analysis to identify relevant influencers within a specific niche or industry.\r\n\r\n- Knowledge of social media platforms and their specific features, algorithms, and best practices for maximum reach and engagement.\r\n\r\n- Skillful negotiation and contract management with influencers, including establishing campaign deliverables, timelines, and compensation.\r\n\r\n- Expertise in tracking and measuring campaign performance through key performance indicators (KPIs), analytics tools, and reporting.\r\n\r\n- Implementation of influencer marketing software and platforms for efficient campaign management, influencer discovery, and performance tracking.\r\n\r\n- Ability to analyze data and insights to optimize campaigns, refine targeting strategies, and maximize return on investment (ROI).', '0.00', '', NULL, NULL, '$2y$10$xUn2ldbZHfuCm.GzS1Obuu/5rz5tQ6hInkjUsgPdPnKL5NDy/DZF6', '1-cgumXPrjTMUb4QBcZ9Sk.jpg', '1-HOZyGkhjZ24EGXjNQ4im.jpg', '0.0000000', '0.0000000', 140, '', '', '', '30.00', '', NULL, NULL, NULL, 0, 1, '2023-07-07 18:11:17', '2024-01-23 15:50:33'),
