(125, 26, 'Ana Silva', '', 2, 'ana.silvamarketing@outlook.com', 'Hello, I m Ana Silva, a skilled freelance professional specializing in email marketing strategies that drive results. I help businesses effectively leverage the power of email to nurture leads, increase brand awareness, and generate meaningful revenue.\r\n\r\nTechnical Competencies and Expertise:\r\n\r\nEmail automation platforms- proficiency in popular email automation tools such as Mailchimp, Constant Contact, and Campaign Monitor, enabling her to create targeted and personalized email campaigns at scale.\r\n\r\nSegmentation and personalization- excel in segmenting email lists based on demographics, behaviors, and interests, allowing her to deliver tailored content that resonates with recipients and boosts engagement.\r\n\r\nA/B testing and analytics- leverage A/B testing methodologies and email analytics to optimize subject lines, content, and call-to-action elements for higher open rates, click-through rates, and conversions.\r\n\r\nCompetencies and Unique Selling Points:\r\n\r\nEngaging content creation:\r\nConversion optimization\r\nContinuous improvement\r\nClient satisfaction\r\n\r\nContact me today to elevate your email marketing efforts and achieve your business goals', '0.00', '', NULL, NULL, '$2y$10$.UZ0usUDEFsSWMF8/0GND.P37Fr2qM9aXYgstaXDaZEuRokq3ro7K', '1-ioyWroto6S7TNySiDcSk.jpg', '1-AZk963XHjE6NP5BBp0Xq.jpg', '0.0000000', '0.0000000', 64, '', '', '', '23.00', '', NULL, NULL, NULL, 0, 1, '2023-07-11 12:45:18', '2024-01-23 16:26:33'),
