(128, 20, 'Rajesh Gupta', '', 1, 'gupta.rajesh10@hotmail.com', 'Hi, I m Rajesh, an accomplished interior designer with a passion for creating inspiring and functional spaces. With expertise in both residential and commercial projects, I offer comprehensive interior design services that transform environments into beautiful, harmonious, and inviting spaces\r\n\r\nMy Areas of Expertise:\r\n\r\nSpace Planning and Layout\r\n\r\nConcept Development and Visualization\r\n\r\nMaterial Selection and Finishes\r\n\r\nColor Schemes and Lighting Design\r\n\r\nCustom Furniture and Millwork Design\r\n\r\nSustainable Design Practices\r\n\r\nTechnical Aspects of My Services:\r\n\r\nCAD Software Proficiency- using computer-aided design (CAD) software such as AutoCAD or SketchUp to create precise floor plans, elevations, and 3D visualizations.\r\n\r\n3D Rendering and Visualization- utilizing advanced rendering software to generate realistic visual representations of the proposed designs, enabling clients to envision the final outcome with accuracy.\r\n\r\nProject Management- providing comprehensive project management services, overseeing the design process from conception to execution, and coordinating with contractors, suppliers, and other professionals to ensure smooth project implementation.\r\n\r\nFeel free to contact me to discuss your interior design needs and embark on a transformative design journey.', '0.00', '', NULL, NULL, '$2y$10$gPEYwvStMAN0Trq8kZ/rMuZySclmgxYX0NySpxV8TJA2nU3aaTTky', '1-nrqHM2w0WxyPN5SQtQBL.jpg', '1-LKnAG4wpt43vGCMjlZKb.jpg', '0.0000000', '0.0000000', 68, '', '', '', '75.00', '', NULL, NULL, NULL, 0, 1, '2023-07-11 15:19:08', '2024-01-23 16:27:20'),
