(1638, 26, 'Jerom Kamiel van Dijk', '', 1, 'jerom.kami@gmail.com', 'Elevate Your Email Campaigns with Jerom Kamiel van Dijk\r\n\r\nHello! I&amp;#39;m Jerom Kamiel van Dijk, your dedicated Email Campaign Setup &amp;amp; Management Specialist. With a strong passion for crafting impactful email marketing strategies, I bring over 5 years of experience in the digital marketing realm. My expertise lies in developing and overseeing email campaigns that not only secure a spot in inboxes but also connect emotionally and intellectually with the audience. Through my skills in targeted content creation and strategic planning, I ensure that each campaign resonates with its intended audience, fostering meaningful engagement and driving results.\r\n\r\nMy Mission:\r\n\r\nCrafting Tailored Campaigns: I specialize in setting up email campaigns that resonate with your audience and align with your brand&amp;#39;s voice.\r\nSeamless Management: From start to finish, I manage your campaigns with precision, ensuring every detail is perfect.\r\nResults-Driven Strategies: My focus is always on achieving tangible results - be it boosting open rates, enhancing engagement, or driving conversions.\r\nHow I Work:\r\n\r\nI combine creativity with analytical skills to build campaigns that are both visually appealing and data-driven.\r\nStaying on top of the latest email marketing trends and tools is my mantra for delivering cutting-edge campaign solutions.\r\nCollaboration is key – I work closely with you to understand your goals and craft strategies that meet your specific needs.\r\nTools at My Disposal:\r\n\r\nSkilled in platforms like Mailchimp, Constant Contact, and ActiveCampaign, I bring the best in technology to optimize your email marketing efforts.\r\nServices:\r\n\r\nComprehensive Email Strategy Development\r\nA/B Testing and Performance Optimization\r\nList Segmentation and Personalization\r\nAutomated Email Funnel Setup\r\nCopywriting and Content Creation\r\nConversion Rate Optimization for Emails\r\nDetailed Analytics and Reporting\r\nIntegration with CRM and Other Tools\r\nReady to Transform Your Email Marketing?\r\n\r\nIf you&amp;#39;re looking to revamp your email campaigns or start a new journey in email marketing, I&amp;#39;m your guy. Let&amp;#39;s collaborate to create email campaigns that not only deliver messages but also deliver results.\r\n\r\n📧 Get in Touch:\r\n\r\nInterested in taking your email campaigns to the next level? Reach out to me, and let’s make email marketing your most powerful tool yet!', '0.00', '', '2023-11-23 01:39:27', '', '$2y$10$S4tgYzOoDf7.vaF0hCmWOOdZbysS0Hoy.mcjBKLBemBHjUUWWhDyO', NULL, '1-BVYMZMkfj7WjluwsCSFU.jpg', '0.0000000', '0.0000000', 166, '', '', '', '24.30', 'Hourly', NULL, 'ppj0ZTlG0h5CXvWM3EDiZcw6oJvgwEvN4Aon16eZuOjuG7366bJNDXgvEmAf', NULL, 0, 0, '2023-11-23 01:38:01', '2024-01-24 15:04:05'),
(1640, 29, 'Sergio Luciano Rodrigues', '', 1, 'sergio.luci@gmail.com', 'Sergio Luciano Rodrigues: Crafting Unique Digital Experiences with Custom Website Design\r\n\r\nHello! I&amp;#39;m Sergio Luciano Rodrigues, a creative and passionate Custom Website Designer with over 6 years of experience. My mission is to bring your brand&amp;#39;s story to life online with beautiful, functional, and unique web designs.\r\n\r\nWhy Choose Sergio for Your Web Design Needs?\r\n\r\nBespoke Designs: I specialize in creating websites that are tailor-made to reflect your brand&amp;#39;s personality and goals.\r\nUser-Focused Creativity: My designs prioritize user experience, ensuring that your site is not only visually appealing but also intuitive and user-friendly.\r\nTechnical Expertise Meets Artistry: I blend artistic design with technical proficiency for websites that perform flawlessly.\r\nMy Design Process:\r\n\r\nCollaborative and client-focused, I work with you at every step to ensure the final product exceeds your expectations.\r\nI keep you updated with regular progress checks and design iterations for continuous refinement.\r\nI employ a strategic approach to design, combining aesthetic appeal with practical functionality.\r\nProficiencies and Tools:\r\n\r\nSkilled in using design tools like Adobe Creative Suite, Sketch, and Figma.\r\nExperienced with front-end technologies for seamless design-to-development transition.\r\nLet&amp;#39;s Build Your Online Presence:\r\n\r\nLooking for a website that stands out and speaks to your audience? I’m here to create a web presence that captures attention and drives engagement.\r\n📧 Ready to Start?\r\n\r\nIf you&amp;#39;re ready to give your brand a unique digital identity, get in touch with me, Sergio Luciano Rodrigues. Let’s create a website that&amp;#39;s as remarkable as your brand!', '0.00', '', NULL, 'Qysgm6Ed1iVfysbbir7jH4HRvhS2ffTheu53KwRCFXZu55KBI4YlvV8PPys8wFQmqUdJxuTKXUEa7ViBCsgawsrfMCygmfwuQ4vH', '$2y$10$fiQARmTaa0t4Gb.7Gy