(1666, 16, 'Satchel Rocchi', '', 1, 'satchel.rocchi@gmail.com', 'Summary:\r\nI am a highly creative and detail-oriented web designer in crafting visually stunning and user-friendly websites. My passion for design, combined with my technical expertise, allows me to create engaging online experiences that meet both aesthetic and functional objectives.\r\n\r\nSkills:\r\n\r\nWeb Design: Proficient in creating modern and responsive web designs that align with client branding and goals.\r\nUI/UX Design: Skilled in user interface (UI) and user experience (UX) design principles to enhance website usability.\r\nHTML/CSS: Strong foundation in HTML and CSS, ensuring designs are implemented accurately.\r\nAdobe Creative Suite: Proficient in using design software such as Photoshop, Illustrator, and XD.\r\nResponsive Design: Experienced in designing websites that adapt seamlessly to various screen sizes and devices.\r\nWireframing and Prototyping: Capable of creating wireframes and interactive prototypes to visualize and test designs.\r\nSEO Awareness: Basic understanding of SEO best practices to optimize website content for search engines.\r\nExperience:\r\n\r\nWeb Designer:\r\n\r\nCollaborate with clients to understand their design requirements and business objectives.\r\nDesign and develop visually appealing and user-friendly websites from concept to completion.\r\nConduct usability testing and gather feedback to make continuous improvements to the user experience.\r\nWork closely with developers to ensure the seamless integration of designs into the final website.\r\nMaintain and update existing websites to reflect changing content and design trends.\r\nFreelance Web Designer\r\nSuccessfully completed several freelance projects for various clients, including small businesses and startups.\r\nDelivered custom website designs tailored to each client&#39;s specific needs and branding.\r\nManaged all aspects of the design process, from initial concept and wireframing to final implementation.\r\nReceived positive feedback and referrals from satisfied clients.\r\nPortfolio Highlights:\r\nProduct sketches and renderings\r\nCAD modeling and 3D printing\r\nPrototyping and testing\r\nProduct lifecycle management\r\nMy skills include:\r\nUser Research and Testing\r\nPrototyping and Wireframing\r\nInteraction Design\r\nUI/UX Design\r\nProduct Lifecycle Management\r\nCollaboration with Cross-functional Teams\r\nAdobe Creative Suite, Sketch, Figma', '0.00', '', NULL, NULL, '$2y$10$PpYgRPH1nuRCTBYIJeW0weMjQmK.QELuo3vf29liXx7H6HYoHXMpm', NULL, '1-W5j5h1uESavhWJiZqgOW.jpg', '0.0000000', '0.0000000', 77, '', '', '', '34.76', '', NULL, NULL, NULL, 0, 1, '2024-01-17 14:24:50', '2024-01-29 10:40:43'),
(1667, 20, 'Flann Dara', '', 2, 'flann.dara@gmail.com', 'Experienced and creative interior designer with a passion for transforming spaces into functional, aesthetically pleasing environments.  I have successfully completed numerous residential and commercial projects, consistently exceeding clients&#39; expectations. My design philosophy is rooted in a deep understanding of my clients&#39; needs, combining practicality and style to create unique and harmonious interiors.\r\n\r\nProfessional Experience:\r\n\r\nPosition: Senior Interior Designer\r\nDuration: \r\nResponsibilities:\r\nLed a team of designers to conceptualize and execute high-end residential projects.\r\nCollaborated with architects and contractors to ensure seamless project coordination.\r\nCreated detailed design plans, mood boards, and 3D visualizations for client presentations.\r\nSourced and selected furniture, materials, and accessories that aligned with project budgets and design aesthetics.\r\nOversaw project installations, ensuring the accurate implementation of design concepts.\r\n\r\n\r\nPosition: Interior Designer Assistant\r\nDuration: \r\nResponsibilities:\r\nAssisted in space planning, material selection, and color coordination for residential and commercial projects.\r\nPrepared AutoCAD drawings and floor plans to communicate design concepts effectively.\r\nConducted market research to stay updated on emerging design trends and innovative products.\r\nSupported senior designers in client meetings and presentations.', '0.00', '', NULL, NULL, '$2y$10$69/Jdj1UgIiz1IV7Bm5NNess0d0u6mF4Tz.4mXKEFT7w44UppqAtK', NULL, '1-SQ4bVSR0Ex8RNh65jRLd.jpg', '0.0000000', '0.0000000', 77, '', '', '', '43.23', '', NULL, NULL, NULL, 0, 1, '2024-01-17 14:30:58', '2024-01-29 10:40:41'),
(1668, 29, 'Tobia Accorso', '', 2, 'tobia.accorso@gmail.com', 'Dedicated and creative Landscape Designer with a passion for transforming outdoor spaces into stunning, functional environments. Adept at blending aesthetics with sustainability and functionality, I bring extensive knowledge of horticulture, design principles, and project management to every project. With a proven track record of delivering exceptional results, I am committed to enhancing the beauty and usability of outdoor spaces while respecting the environment.\r\n\r\nSkills:\r\n\r\nLandscape Design\r\nPlant Selection and Horticulture\r\nAutoCAD and 3D Modeling\r\nSite Analysis and Evaluation\r\nSustainable Design Practices\r\nProject Management\r\nBudgeting and Cost Estimation\r\nClient Communication and Consultation\r\nConstruction Oversight\r\nEnvironmental Conservation\r\nCreative Problem Solving\r\nTeam Collaboration\r\nExperience:\r\n\r\nSenior Landscape Designer:\r\n\r\nLead the design and execution of a wide range of residential and commercial landscape projects.\r\nConduct comprehensive site assessments and analyses to understand client needs, environmental conditions, and local regulations.\r\nDevelop detailed landscape plans using AutoCAD and 3D modeling software to visualize design concepts for clients.\r\nCollaborate with architects, contractors, and horticulturists to ensure successful project implementation.\r\nEmphasize sustainable design practices, including water conservation, native plant use, and eco-friendly materials.\r\nManage project budgets, timelines, and resources to meet or exceed client expectations.', '0.00', '', NULL, NULL, '$2y$10$O8275ogAfQn1.ParW9c0mO3vJLaEGs2/UnVkfo2ZAlSXlfNUnn8Sa', NULL, '1-dQ2MlbDkL8QghC618raM.jpg', '0.0000000', '0.0000000', 77, '', '', '', '23.56', '', NULL, NULL, NULL, 0, 1, '2024-01-17 14:32:09', '2024-01-29 10:40:39'),
(1669, 30, 'Mark Grover', '', 1, 'mark.grover@gmail.com', 'Passionate and highly skilled Motion Designer in creating captivating and visually stunning animations, graphics, and visual effects. Proficient in industry-standard software such as Adobe After Effects, Adobe Premiere Pro, and Cinema 4D. Adept at translating ideas into compelling motion graphics that engage and resonate with audiences. Committed to delivering top-quality work on time and within budget.\r\n\r\nProfessional Experience:\r\n\r\nConceptualize and create motion graphics for a variety of projects, including advertisements, promotional videos, and corporate presentations.\r\nCollaborate with clients and creative teams to develop visual concepts and storyboards.\r\nDesign and animate 2D and 3D graphics, typography, and special effects.\r\nEdit and enhance video footage to meet project requirements.\r\nEnsure consistency and brand alignment in all visual elements.\r\n\r\nAssisted senior motion designers in the creation of animations and visual effects.\r\nParticipated in brainstorming sessions and contributed creative ideas.\r\nLearned and mastered animation techniques, software, and tools.\r\nSupported the production team in various aspects of motion design projects.\r\nFreelance Motion Designer | [Month Year] - Present\r\n\r\nWorked with a diverse range of clients on various freelance projects.\r\nProduced motion graphics for social media campaigns, product launches, and event promotions.\r\nManaged project timelines, budgets, and client communications.\r\nBuilt a strong portfolio of successful freelance projects.\r\n\r\nSkills:\r\n\r\nMotion Graphics\r\n2D and 3D Animation\r\nVideo Editing\r\nVisual Effects\r\nAdobe Creative Suite (After Effects, Premiere Pro, Photoshop, Illustrator)\r\nCinema 4D\r\nStoryboarding\r\nTypography\r\nColor Theory\r\nClient Communication\r\nProject Management', '0.00', '', NULL, NULL, '$2y$10$CXl9MQxxDD5QGpOV4uTsOOhA0c2Z3NvoAyEUPoNxB/L/CrQrgjHPq', NULL, '1-5lHXDm6LzRSI