(1686, 29, 'Christian Vonthron', '', 1, 'christian@gmail.com', 'I&amp;#39;m Christian, a Landscape Architect with a Master&amp;#39;s in Landscape Architecture and over 15 years of experience designing harmonious outdoor spaces that respect the earth and elevate the human experience.\r\nServices Offered:\r\nUrban Design and Public Spaces\r\nTherapeutic Garden Design\r\nSustainable Land Use Planning\r\nXeriscaping and Drought-Tolerant Landscapes\r\nCommunity Garden and Edible Landscapes\r\nPlaygrounds and Recreational Areas\r\nEnvironmental Impact Assessments\r\nLandscape Restoration and Rehabilitation\r\nSustainable Landscapes: Every landscape tells a story. Let’s write yours with an emphasis on sustainability, beauty, and functionality. My approach is collaborative and research-driven, aiming to create landscapes that benefit both people and the planet. If you have a vision for an outdoor space, let&amp;#39;s bring it to life together.', '0.00', '', NULL, NULL, '$2y$10$n4oyusKxIs5apEAwKd/8GOQgFfQiANUb8dssDX0DYL06frYrKlXCO', '1-sN80JEr0wWx7BCfjGI4d.jpg', '1-ftFT6UH81tplLOwrDqRs.jpg', '0.0000000', '0.0000000', 57, '', '', '', '13.99', '', NULL, NULL, NULL, 1, 1, '2024-01-22 10:46:46', '2024-01-26 11:16:36'),
