(1688, 32, 'Parastoo Razaghi', '', 0, 'parastoo@gmail.com', 'Hello, I&amp;#39;m Parastoo, an avant-garde Fashion Designer with a Master&amp;#39;s in Fashion Design and Technology and over 7 years of experience in haute couture and ready-to-wear collections.\r\nServices Offered:\r\nBespoke Bridal and Evening Wear\r\nMen&amp;#39;s Tailoring and Couture\r\nEthical and Sustainable Fashion Design\r\nCostume Design for Film and Theatre\r\nFashion Consulting for Brands and Startups\r\nDigital Fashion Illustration\r\nFabric Sourcing and Innovation\r\nFashion Education and Workshops\r\nCouture Creativity: Fashion is the ultimate form of self-expression, and I am here to tailor that expression to fit you perfectly. Whether you seek the exclusivity of a custom-designed gown or a signature piece for your wardrobe, I deliver craftsmanship and innovation in every stitch. Let’s design the future of fashion together.', '0.00', '', NULL, NULL, '$2y$10$64zvtw5X0hSK9qjSzVoi5OwVACGiv70TUXACGYOkJC5O42dyYG1cO', '1-k2umWCRCcGHcrAD4anAf.jpg', '1-Hbee7EU2HKHhjBgLjpMc.jpg', '0.0000000', '0.0000000', 166, '', '', '', '12.20', '', NULL, NULL, NULL, 1, 1, '2024-01-22 10:48:09', '2024-01-26 11:36:30'),
(1689, 33, 'Otto Balthasar Worner', '', 1, 'otto@gmail.com', 'I&amp;#39;m Otto, an Illustrator with a strong background in both digital and traditional art, holding a degree in Illustration, and with 5 years of experience working with a variety of clients from publishing to advertising.\r\nServices Offered:\r\nEditorial Illustration for Magazines and Newspapers\r\nCover Art for Books and Albums\r\nVisual Development for Animation and Games\r\nMerchandise Design\r\nCommissioned Artwork for Private Collectors\r\nEducational and Scientific Illustration\r\nMural Design and Public Art Projects\r\nBrand Mascot Design\r\nVisual Storytelling: An image is worth a thousand words, and I&amp;#39;m here to help you tell your story through art. Whether you&amp;#39;re an author looking for the perfect book cover or a business in need of engaging visual content, I provide custom illustrations that speak to your audience. Let&amp;#39;s collaborate to make your visual narrative unforgettable.', '0.00', '', NULL, NULL, '$2y$10$1mANsVCoGnqZvTh7y6j6MOD7yZZzbmCpiLcQvwkdlL4GYIKYuCBtm', '1-YnbWlXSoXgUsrXgUzh9j.jpg', '1-O73AwsPSp74DfOcolVBd.jpg', '0.0000000', '0.0000000', 57, '', '', '', '12.90', '', NULL, NULL, NULL, 1, 1, '2024-01-22 10:48:51', '2024-01-26 11:37:06'),
(1690, 31, 'Ilja Kiuila', '', 1, 'ilja@gmail.com', 'I&amp;#39;m Ilja, a Brand and Graphic Design expert with an MFA in Design and 12 years of experience in crafting visual solutions that empower brands and businesses to communicate their message effectively.\r\nServices Offered:\r\nStrategic Brand Consultation\r\nIntegrated Marketing Campaigns\r\nExhibition and Event Branding\r\nCorporate Reports and Publications\r\nInteractive Design for Digital Platforms\r\nMotion Graphics for Brand Promotions\r\nMulticultural and Inclusive Design Strategies\r\nCrisis Communication Design\r\nBranding with Purpose: In the intersection of design and strategy lies the power of branding. I am dedicated to creating brands that resonate and represent your values authentically. From startups to multinational corporations, I provide the visual tools you need to connect with your audience. Let&amp;#39;s build a brand that speaks volumes.', '0.00', '', NULL, NULL, '$2y$10$oKkHW.tVICLz0vrVSrpsb.qY5y5Ahr8wlloZWzvhFqal0ckKoCop2', '1-z48vs94Fm6n1pNyIP57a.jpg', '1-sG41si6r2A5zQIXDpMu4.jpg', '0.0000000', '0.0000000', 57, '', '', '', '0.00', '', NULL, NULL, NULL, 1, 1, '2024-01-22 10:49:51', '2024-01-26 11:38:30'),
(1691, 16, 'Denis Schitz', '', 1, 'deniss@gmail.com', 'I&amp;#39;m Denis, a Web Designer and Developer with a passion for creating sleek, high-performance websites. With a BSc in Information Technology and 6 years of hands-on experience, I specialize in marrying aesthetics with functionality.\r\nServices Offered:\r\nCustom Web Application Design\r\nFull-Stack Development\r\nCMS Theme Development and Customization\r\nLanding Page Design and Conversion Rate Optimization\r\nAPI Integration and Third-Party Services\r\nCybersecurity Best Practices Implementation\r\nData Analytics and User Behavior Tracking\r\nTechnical SEO and Content Strategy\r\nTech Meets Design: Your website is your business&amp;#39;s digital heartbeat. I bring a blend of technical expertise and design flair to ensure that your site not only looks good but works flawlessly. Whether you&amp;#39;re an entrepreneur or a large enterprise, I&amp;#39;m here to build your digital foundation. Let&amp;#39;s create a web experience that accelerates your business.', '0.00', '', NULL, NULL, '$2y$10$3TAHZeaf2sbRzLm9SiWqFODKhTMz1PqzYtYtF5YWyzZuatpomH8qG', '1-jxpYOWXnJbrxmXdM0p9L.jpg', '1-YQhFCrYVmJ2MRj2nHhmJ.jpg', '0.0000000', '0.0000000', 57, '', '', '', '17.90', '', NULL, NULL, NULL, 1, 1, '2024-01-22 10:50:30', '2024-01-29 14:56:01'),
